INSERT INTO `channel` (`channel_id`,`chunk_size`,`bitrate`,`name`,`description`) VALUES (2,1024,4500,'Cartoon Network','t is the best channel for kids, but it can still be enjoyed by older viewers. Ed, Edd, and Eddy, Adventure Time, Teen Titans, Dexter\'s Laboratory, Regular Show, Johnny Bravo, Powerpuff Girls, Ben 10, The Amazing World of Gumball, Foster\'s Home For Imaginary Friends, Codename: Kids Next Door, Chowder, Total Drama, Samurai Jack, Grim Adventures of Billy & Mandy, Cow and Chicken, Camp Lazlo, My Gym Partner\'s a Monkey, and so much more.');
INSERT INTO `channel` (`channel_id`,`chunk_size`,`bitrate`,`name`,`description`) VALUES (3,1500,2000,'HBO','HBO. The most brilliant channel ever created on television. Not only does it provide tons of old and new flicks, most of them are good, and some great intermissions with a good overall look of upcoming flicks, but also provides some great shows-I\'m looking at you Game of Thrones-with low commercial issues and a cool name. Must own channel.');
INSERT INTO `channel` (`channel_id`,`chunk_size`,`bitrate`,`name`,`description`) VALUES (4,1400,2500,'FOX','The best comedy and animated series which include The Simpsons, Family Guy, American Dad!, The Cleveland Show, Raising Hope and the sitcom I Hate My Teenage Daughter. FOX also has Napoleon Dynamite (animated series) coming and The Flintstones remake in 2013. FOX also has The X Factor USA.');
INSERT INTO `channel` (`channel_id`,`chunk_size`,`bitrate`,`name`,`description`) VALUES (5,1000,6000,'Comedy Central','CHAPPEL SHOW, MAD TV, JON STEWART. THESE SHOWS GOT ME CRACKING UP.');
INSERT INTO `channel` (`channel_id`,`chunk_size`,`bitrate`,`name`,`description`) VALUES (6,1850,4500,'Discovery Channel','This channel is the most educational, entertaining and amazing channel I\'ve ever watched. The producers of this show pay tons.. And I mean Tons of money to make the shows that we love happen. Mythbusters is my favorite show ever and throughout the years I have learned from discovery channel perhaps more than school.');
